import React from "react";
import "./contact.css";  
import github from "../assets/github.png"; 
import linkedin from "../assets/linkedin.png";

export default function About() {  
  return (
    <div
      className="overflow-y-hidden" 
      id="about"
      style={{
        backgroundColor: "#e7e7e7",
        marginTop: "0",
        height: "100vh",
        fontFamily: "public-sans",
      }}
    >    
    <div className="d-block mx-auto" style={{width: "60vw", backgroundColor:"rgba(194, 191, 197, 0.25)", borderRadius:"24px"}}>
    <p className="text-center pt-4">Contact Me</p>  
    <div className="d-flex flex-row">  
        <a href="mailto:lauren.langbort@tufts.edu">lauren.langbort@tufts.edu</a>  
        <div className="d-flex flex-column"> 
        <p></p> 
        <div>
        <a href="https://github.com/laurenlangbort"><img src={github} alt="" width="45" /></a> 
        <a href="https://github.com/laurenlangbort"><img src={linkedin} alt="" width="45" /></a>  
        </div>
        </div>
    </div>
    </div>
    </div>
  );
};
